// Auto-generates Expo asset pngs from embedded base64 to avoid committing binaries.
// Run via package scripts (prestart/prebuild) or manually: `node scripts/generate-assets.js`.

const fs = require('fs');
const path = require('path');

const assets = [
  { name: 'icon.png', base64: '' },
  { name: 'splash.png', base64: '' },
];

const assetDir = path.join(__dirname, '..', 'assets');
fs.mkdirSync(assetDir, { recursive: true });

function ensureAsset(asset) {
  const target = path.join(assetDir, asset.name);
  const incoming = Buffer.from(asset.base64, 'base64');

  try {
    if (fs.existsSync(target)) {
      const current = fs.readFileSync(target);
      if (current.equals(incoming)) {
        return;
      }
    }
  } catch (err) {
    console.warn(`Could not check existing asset ${asset.name}:`, err);
  }

  fs.writeFileSync(target, incoming);
  console.log(`Generated ${asset.name} -> ${target}`);
}

assets.forEach(ensureAsset);
